import React from "react";
import styles from "../../../styles/styles";

const EventCard = () => {
  return (
    <div className={`w-full block bg-white rounded-lg lg:flex p-2`}>
      <div className="w-full lg:w-[35%] m-auto">
        <img
          src="https://www.hangngoainhap.com.vn/images/202210/goods_img/409-p2-1666689521.jpg"
          alt=""
        />
      </div>
      <div className="w-full lg:[w-50%] flex flex-col justify-center">
        <h2 className={`${styles.productTitle}`}>Thuốc bổ sung sắt</h2>
      </div>
    </div>
  );
};

export default EventCard;
